// Map Method
// https://jsonplaceholder.typicode.com/todos
import { useEffect, useState } from "react";
import  "./index.css"

function Demo(){
    const [data,setData]=useState("")
    useEffect(()=>{
        fetch("http://localhost:3006/Employee")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
    })
    return(
        <div>
        <h1>HOOK'S METHODS</h1>
        <table>
            <thead>
                <tr>
                    <th>userId</th>
                    <th>Id</th>
                    <th>Title</th>
                </tr>
            </thead>
            <tbody>
                {data.map((item)=>(

               
                <tr>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.city}</td>
                    <td>{item.mobile}</td>
                </tr>
                 ))}
            </tbody>
        </table>
        </div>
    )
}
export default Demo;
